import NavBar from "../NavBar";

function HomePage(){
    return (
        <div className="home">
            <NavBar/>
            {/* left/top side of screen  */}
            <div className="bg-[#393053] border-r-white h-[33%]">

            </div>

            {/* div containing image  */}
            <div className="img-con relative h-[300px] w-[255px] bg-[#18122B] left-[25%] top-[-22%]">

            </div>

            {/* right/down side of screen with content  */}
            <div className="h-[60%] flex-col mt-0 ">
                <p className="text-white text-2xl">Hi, I'm Shreya!</p>
                <p className="text-white">I'm a Software Developer.</p>
            </div>
        </div>
    );
}

export default HomePage;
